    [],nt"revision_timestamp": "2015-06-12T19:34:17.055760",nt"name": "2014-cartographic-boundary-file-american-indian-area-alaska-native-area-hawaiian-home-land-for-",nt"isopen":
    false,nt"url": null,nt"notes": "The 2014 cartographic boundary shapefiles
    are simplified representations of selected geographic areas from the U.S. Census
    Bureau's Master Address File / Topologically Integrated Geographic Encoding and
    Referencing (MAF/TIGER) Database (MTDB). These boundary files are specifically designed
    for small-scale thematic mapping. When possible, generalization is performed with
    the intent to maintain the hierarchical relationships among geographies and to maintain
    the alignment of geographies within a file set for a given year. Geographic areas
    may not align with the same areas from another year. Some geographies are available
    as nation-based files while others are available only as state-based files.nnThe
    American Indian/Alaska Native/Native Hawaiian (AIANNH) Areas cartographic boundary
    file includes generalized versions of the following legal entities: federally recognized
    American Indian reservations and off-reservation trust land areas, state-recognized
    American Indian reservations, and Hawaiian home lands (HHLs).  The statistical entities
    included are Alaska Native village statistical areas (ANVSAs), Oklahoma tribal statistical
    areas (OTSAs), tribal designated statistical areas (TDSAs), and state designated
    tribal statistical areas (SDTSAs).  Joint use areas are also included in this shapefile
    refer to areas that are administered jointly and/or claimed by two or more American
    Indian tribes.  The Census Bureau designates both legal and statistical joint use
    areas as unique geographic entities for the purpose of presenting statistical data.
     Note that tribal subdivisions and Alaska Native Regional Corporations (ANRCs)
    are additional types of American Indian/Alaska Native areas stored by the Census
    Bureau, but are displayed in separate files because of how they fall within the
    Census Bureau's geographic hierarchy.",nt"license_title": null,nt"extras":
